import React from 'react';
import '../App.css';

class Home extends React.Component {

  render() {
    return (
        <div className="App" style={{height: '100vh', overflow: 'auto'}}>
         
          <div className="centered d-flex align-items-center">
          <h1 className="display-1">Welcome to Book Keeper</h1>
          <p><small>Your personal online bookshelf</small></p>

          </div>
          
        </div>
    );
  }
}
export default Home;
